import React, { useState, useEffect } from "react";
import axios from "axios";
import { Card, CardBody, CardTitle, CardSubtitle, Table } from "reactstrap";
import { Navigate } from "react-router-dom";

const Course = () => {
    const [course, setCourse] = useState()

    const getApiCourse = async () => {
        const res = await axios.get(`http://localhost:8080/api/v1/course/getPage`);
        const data = res.data ? res.data : []
        setCourse(data)
    }

    useEffect(() => {
        getApiCourse();
    }, [])

    const navigate = (id) => {
        <Navigate to={`/${id}`} />
    }

    return (
        <div>
            <Card>
                {course &&
                    <Table className="no-wrap mt-3 align-middle" responsive borderless>
                        <thead>
                            <tr>
                                <th>Code</th>
                                <th>Tên</th>
                                <th>Giới thiệu</th>
                                <th>Giá</th>
                                <th>Đang học</th>
                                <th>Đăng ký</th>
                                <th>Thời gian</th>
                            </tr>
                        </thead>
                        <tbody>
                            {course.content.map(item => (
                                <tr onClick={() => navigate(item.id)} key={item.id} className="border-top">
                                    <td>
                                        {item.code}
                                    </td>
                                    <td>
                                        {item.name}
                                    </td>
                                    <td>
                                        {item.introduce}
                                    </td>
                                    <td>
                                        {item.price}
                                    </td>
                                    <td>
                                        {item.numberOfStudent}
                                    </td>
                                    <td>
                                        {item.numberOfPurchases}
                                    </td>
                                    <td>
                                        {item.totalCourseDuration}
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </Table>
                }
            </Card>
        </div>
    );
};

export default Course;
